SELECT ( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
) AS count
,t2.pro_process_name ,( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
AND t1.pro_process_name = t2.pro_process_name
) AS process_count ,( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
AND t1.pro_process_name = t2.pro_process_name
)/( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
) AS percent
,t2.pro_type_name ,( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
AND t1.pro_type_name = t2.pro_type_name
) AS type_count ,( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
AND t1.pro_type_name = t2.pro_type_name
)/( SELECT COUNT( t1.project_id ) FROM zj_tz_pro_manage t1
t1.del_flag = '0' and t1.project_type = '0'
AND t1.project_id = #{projectId}
AND t1.project_id in (${projectIdSql})
) AS percent
FROM zj_tz_pro_manage t2
t2.del_flag = '0' and t2.project_type = '0'
AND t2.project_id = #{projectId}
AND t2.project_id in (${projectIdSql})
GROUP BY t2.pro_process_name ORDER BY FIELD(pro_process_id,0),CONVERT(pro_process_id,SIGNED) ASC
GROUP BY t2.pro_type_name ORDER BY FIELD(pro_type_id,'2.2','2.3','2.1',null,'')

SELECT pro_no, project_name, project_short_name, company_name, amount1, amount3, company7, pro_type_name, pro_process_name, area_name FROM zj_tz_pro_manage
del_flag = '0' and project_type = '0'
and project_id = #{projectId}
and project_id in (${projectIdSql})
and zj_tz_pro_manage.company_name LIKE concat('%', #{companyName}, '%')
and zj_tz_pro_manage.pro_type_name = #{proTypeName}
and zj_tz_pro_manage.pro_process_name = #{proProcessName}
and zj_tz_pro_manage.area_name LIKE concat('%', #{areaName}, '%')
ORDER BY CAST( sort1 AS DECIMAL ),zj_tz_pro_manage.pro_no

SELECT project_id, pro_no, project_name, project_short_name, company_name, construct_end, IFNULL(construct_period,0) AS construct_period, DATE_FORMAT( NOW( ), '%Y-%m-%d' ) AS currdate, actual_date, complate_date_plan, handover_date_plan, complate_date_actrual, handover_date_actrual, analy_subject, approval_handover_date, approval_complete_date FROM zj_tz_pro_manage
del_flag = '0' and project_type = '0'
and project_id = #{projectId}
